import React from "react";
import Layout from "../components/layout";

const Dashboard = () => {
  return (
    <React.Fragment>
      <Layout>
        <div className="h-screen">
          <h1>Dashboard Page</h1>
        </div>
      </Layout>
    </React.Fragment>
  );
};

export default Dashboard;
